I wanna brief a little about me..
Right from childhood, Writing and Singing was my passion, writing kept developing from letters/cards (to pen friends n relatives) to emotional expressions, in the form of nazams/gazals, as life tought. 
In the year 2011, The Great Gazal Maestro JAGJIT SINGH ji told me that he will compose 2 gazals from my book 'Zindagi Ye Zindagi' and same will feature in his next album, but very sadly he passed away on 10th October, 2011 due to brain hemorrhage. As a lot of his work was in pipeline, I failed to find the compositions.
There after my writings took the shape of a couple of film scripts. I joined Film Writers Association, got my work registered with F.W.A. Submitted the scripts to studios. Same are still lying pending as I couldn't kept knocking the entrance due to some other commitments.
I sum up by saying, it's not about attaining some thing big but it's about not losing the hope.
Same is the message of this song..
